import java.util.regex.Pattern;
import java.util.regex.Matcher;

private Pattern p1 = Pattern.compile("<a href=\"(eo_.*?\.xls)", Pattern.DOTALL);
//private Pattern p2 = Pattern.compile("<a href=\"(eo_.*?\.zip)\"", Pattern.DOTALL);


public boolean processRow(StepMetaInterface smi, StepDataInterface sdi) throws KettleException
{

	// boilerplate
	Object[] r = getRow();

	if (r == null) {
		setOutputDone();
		return false;
	}

	Matcher m1 = p1.matcher(get(Fields.In, "body").getString(r));
	//Matcher m2 = p2.matcher(get(Fields.In, "body").getString(r));

	while(m1.find()){
		r = createOutputRow(r, data.outputRowMeta.size());
		get(Fields.Out, "filename").setValue(r, m1.group(1));
		putRow(data.outputRowMeta, r);
	}



	return true;
}

import java.util.regex.Pattern;
import java.util.regex.Matcher;

private Pattern p = Pattern.compile("<a href=\"(eo_.*?\.xls)", Pattern.DOTALL);


public boolean processRow(StepMetaInterface smi, StepDataInterface sdi) throws KettleException
{

	// boilerplate
	Object[] r = getRow();

	if (r == null) {
		setOutputDone();
		return false;
	}

	Matcher m = p.matcher(get(Fields.In, "body").getString(r));

	while(m.find()){
		r = createOutputRow(r, data.outputRowMeta.size());
		get(Fields.Out, "filename").setValue(r, m.group(1));
		putRow(data.outputRowMeta, r);
	}

	return true;
}

